import React, { useState } from "react";
import { Select, Divider, Collapse, Form, Button, Row, Col, Card, Input, DatePicker, TimePicker } from 'antd';
import { PlusOutlined, MinusCircleOutlined } from "@ant-design/icons";
import { useSelector } from "react-redux";
import { useHistory } from "react-router";
import ConfirmationModal from "components/Modal/ConfirmationModal";

export default function TrackingSheet() {
    const { Option } = Select;
    const { Panel } = Collapse;
    const { TextArea } = Input;
    const history = useHistory();
    const project = useSelector(state => state.authReducer.userProject);
    const initialProppantFormValues =  { proppantData: [{ description: null, specific_gravity: null, bulk_density: null }] }
    const [items, setItems] = useState(['Stage 1']);
    const [showConfirmationModal, setShowConfirmationModal] = useState();
    const [modalData, setModalData] = useState();
    const [wellId, setWellId] = useState();

    const handleCancel = () => {
        setShowConfirmationModal(false);
        setModalData(null);
    }

    const addStage = () => {
        setShowConfirmationModal(true);
    }

    const handleAddStageConfirmed = (data) => {
        addItem();
        setShowConfirmationModal(false);
        setModalData(null);
    }

    const onFormSubmit = (values) => {
        console.log(values);
    };

    const onDateChange = (date, dateString)  => {
        console.log(date, dateString);
    }

    const showAddItemModal = () => {

    }

    const addItem = () => {
        setItems([...items, `Stage ${items.length + 1} (Added)`])
    };

    useState(() => {
        const wellId = history.location.pathname.split("/admin/")[1].split("/")[1];
        setWellId(wellId);
        const well = project.wellInfoValues.find(well => well.id == wellId);
        console.log(well);
        const stages = [];
        for (let step = 1; step <= well.no_of_stages; step++) {
            stages.push("Stage " + step);
        }
        setItems(stages);
    }, [])
    return (
        <>
            {
                wellId && <>
                    <Card bordered={false} style={{ width: '100%', marginBottom: '5px' }}>
                        <div className="">
                            <Row gutter={24} className="flex items-center">
                                <Col span={20}>
                                    <div><strong>Tracking sheet</strong></div>
                                </Col>
                                <Col span={4}>
                                    <Select
                                        style={{ width: "100%" }}
                                        placeholder="Stage"
                                        defaultValue={items[0]}
                                        dropdownRender={menu => (
                                            <div>
                                                {menu}
                                                <Divider style={{ margin: '4px 0' }} />
                                                <div style={{ display: 'flex', flexWrap: 'nowrap', padding: 8 }}>
                                                <a
                                                    style={{ flex: 'none', padding: '8px', display: 'block', cursor: 'pointer' }}
                                                    onClick={(e) => addStage()}
                                                >
                                                    <PlusOutlined /> Add stage
                                                </a>
                                                </div>
                                            </div>
                                        )}
                                    >
                                        {items.map(item => (
                                            <Option key={item}>{item}</Option>
                                        ))}
                                    </Select>
                                </Col>
                            </Row>
                        </div>
                    </Card>
                    <Card>
                        <Collapse defaultActiveKey={['0']}>
                            <Panel header={<strong>Stage Tracking</strong>} >
                                <Card>
                                    <Form
                                        name="dynamic_form_nest_item"
                                        onFinish={onFormSubmit}
                                        autoComplete="off"
                                    >
                                        <Row gutter={24}>
                                            <Col span={10}>
                                                <Form.Item
                                                    name={'date'}
                                                    label="Date"
                                                    labelCol={{span: 5, offset: 0}}
                                                    labelAlign="left"
                                                >
                                                    <DatePicker onChange={onDateChange} className="w-full"/>
                                                </Form.Item>
                                            </Col>
                                            <Col span={10}></Col>
                                        </Row>
                                        <Row gutter={24}>
                                            <Col span={8}>
                                                <Form.Item
                                                    name={'customer'}
                                                    label="Customer"
                                                    labelCol={{span: 7, offset: 0}}
                                                    labelAlign="left"
                                                >
                                                    <Input className="w-full"/>
                                                </Form.Item>
                                            </Col>
                                            <Col span={10}>
                                                <Form.Item
                                                    name={'field_engineer_days'}
                                                    label="Field engineer (Days)"
                                                    labelCol={{span: 10, offset: 0}}
                                                    labelAlign="left"
                                                >
                                                    <Input className="w-full"/>
                                                </Form.Item>
                                            </Col>
                                        </Row>
                                        <Row gutter={24}>
                                            <Col span={8}>
                                                <Form.Item
                                                    name={'well'}
                                                    label="Well"
                                                    labelCol={{span: 7, offset: 0}}
                                                    labelAlign="left"
                                                >
                                                    <Input className="w-full"/>
                                                </Form.Item>
                                            </Col>
                                            <Col span={10}>
                                                <Form.Item
                                                    name={'field_engineer_nights'}
                                                    label="Field engineer (Nights)"
                                                    labelCol={{span: 10, offset: 0}}
                                                    labelAlign="left"
                                                >
                                                    <Input className="w-full"/>
                                                </Form.Item>
                                            </Col>
                                        </Row>
                                        <Row gutter={24}>
                                            <Col span={8}>
                                                <Form.Item
                                                    name={'stage'}
                                                    label="Stage"
                                                    labelCol={{span: 7, offset: 0}}
                                                    labelAlign="left"
                                                >
                                                    <Input className="w-full"/>
                                                </Form.Item>
                                            </Col>
                                            <Col span={10}>
                                                <Form.Item
                                                    name={'plug_type'}
                                                    label="Plug type"
                                                    labelCol={{span: 10, offset: 0}}
                                                    labelAlign="left"
                                                >
                                                    <Input className="w-full"/>
                                                </Form.Item>
                                            </Col>
                                            </Row>
                                        <Row gutter={24}>
                                            <Col span={8}>
                                                <Form.Item
                                                    name={'bht_f'}
                                                    label="BHT [F]"
                                                    labelCol={{span: 7, offset: 0}}
                                                    labelAlign="left"
                                                >
                                                    <Input className="w-full"/>
                                                </Form.Item>
                                            </Col>
                                            <Col span={10}>
                                                <Form.Item
                                                    name={'plug_seat_technique'}
                                                    label="Plug seat technique"
                                                    labelCol={{span: 10, offset: 0}}
                                                    labelAlign="left"
                                                >
                                                    <Input className="w-full"/>
                                                </Form.Item>
                                            </Col>
                                        </Row>
                                        <Row gutter={24}>
                                            <Col span={8}>
                                                <Form.Item
                                                    name={'bht_psi'}
                                                    label="BHT [psi]"
                                                    labelCol={{span: 7, offset: 0}}
                                                    labelAlign="left"
                                                >
                                                    <Input className="w-full"/>
                                                </Form.Item>
                                            </Col>
                                            <Col span={10}>
                                                <Form.Item
                                                    name={'event_occur'}
                                                    label="Did an event occur"
                                                    labelCol={{span: 10, offset: 0}}
                                                    labelAlign="left"
                                                >
                                                    <Input className="w-full"/>
                                                </Form.Item>
                                            </Col>
                                        </Row>
                                        <Row gutter={24}>
                                            <Col span={8}>
                                                <Form.Item
                                                    name={'frac_design'}
                                                    label="Frac design"
                                                    labelCol={{span: 7, offset: 0}}
                                                    labelAlign="left"
                                                >
                                                    <Input className="w-full"/>
                                                </Form.Item>
                                            </Col>
                                            <Col span={10}>
                                                <Form.Item
                                                    name={'seismos_data_collection'}
                                                    label="Seismos data collection"
                                                    labelCol={{span: 10, offset: 0}}
                                                    labelAlign="left"
                                                >
                                                    <Input className="w-full"/>
                                                </Form.Item>
                                            </Col>
                                        </Row>
                                    </Form>
                                </Card>
                            </Panel>
                            <Panel header={<strong>Perforation interval information</strong>} >
                                <Card>
                                    <Form
                                        name="perforation_interval_information"
                                        onFinish={onFormSubmit}
                                        autoComplete="off"
                                    >
                                        <Row gutter={24}>
                                            <Col span={10}>
                                                <Form.Item
                                                    name={'top_perf'}
                                                    label="Top perf [MD]"
                                                    labelCol={{span: 9, offset: 0}}
                                                    labelAlign="left"
                                                >
                                                    <Input className="w-full"/>
                                                </Form.Item>
                                            </Col>
                                            <Col span={10}>
                                                <Form.Item
                                                    name={'perf_daiameter'}
                                                    label="Perf daiameter [in]"
